import React from "react";
import { SideNavBar, TopNavBar } from "./Navbar";

function Header({ currentUser }) {

    const conditionalSideNavBar = currentUser === undefined ? <div></div> : <SideNavBar />
    const logOutBtn = <button onClick={handleLogOut}>Log Out</button>;
    const conditionalLogOut = currentUser === undefined ? <span></span> : logOutBtn;

    return (
        <div id="header">
            <h1 id="title">inFormation</h1>
            <TopNavBar />
            {conditionalSideNavBar}
            {conditionalLogOut}
        </div>
    );
};

export default Header;
